//get main js

$(document).ready(function () {
    
    var checkEditorTime = new Date().getTime();
    var checkEditorInterval = setInterval(function(){
        if(new Date().getTime() - checkEditorTime > 30000){
            clearInterval(checkEditorInterval);
            return;
        }
        if ($(".w-editor-body")[0]){
            $('.loading-posts > div').text('The social feed is deactivated in editor mode...');
            $('.preloader').fadeOut('slow');
            $('.preloader,.loading-posts-image,#socialPosts').remove();
        }
    }, 2000);
    

    $('[data-fancybox]').fancybox({
        protect: true,
        hash: false,
        animationEffect: "zoom-in-out"
    });

    $('.custom-donate-field').attr('type', 'number');

    $('.donate-select').each(function () {
        $(this).click(function () {
            $(this).css({
                'border-color': '#be1e2d',
                'background-color': '#be1e2d',
                'color': 'white'
            });
            $(this).siblings('.donate-select').removeAttr('style');
            $(this).children('.select-icon').css({
                'opacity': '1'
            });
            $(this).siblings('.donate-select').children('.select-icon').removeAttr('style');
            $('.custom-donate-field').val('');
        });
    });

    $('.donate-radio').each(function () {
        $(this).click(function () {
            $('.form-amount').val($(this).attr('value'));
        });
    });

    $('.custom-donate-field').keyup(function () {
        $('.donate-radio').prop('checked', false);
        $('.donate-select').removeAttr('style');
        $('.select-icon').removeAttr('style');
        $('.form-amount').val($(this).val());
        if ($(this).val().length > 0) {
            $('.custom-dollar').show();
        }
    });

    $('.custom-donate-field,.form-field-other').each(function () {
        $(this).focus(function () {
            $(this).siblings('.field-icon').css('background-color', '#be1e2d');
        }).blur(function () {
            $(this).siblings('.field-icon').removeAttr('style');
        });
    });

    $('form').on('focus', 'input[type=number]', function (e) {
        $(this).on('wheel', function (e) {
            e.preventDefault();
        });
    });

    $('form').on('blur', 'input[type=number]', function (e) {
        $(this).off('wheel');
    });

    $('form').on('keydown', 'input[type=number]', function (e) {
        if (e.which == 38 || e.which == 40)
            e.preventDefault();
    });


    // Feed options

    $("body").on('DOMSubtreeModified', "#socialPosts", function () {
        $('.loading-posts').hide();
    });

    $('#socialPosts').socialfeed({
        facebook: {
            accounts: ['@KarinHousleyMN'],
            limit: 8,
            access_token: '513575985688025|453a9237dd4d16afaa237e089ea991a5'
        },

        twitter: {
            accounts: ['@karinhousley'],
            limit: 8,
            consumer_key: 'rgD3eSEO5vppiZ3171Qy5iZYT',
            consumer_secret: 'dmbOevyGc84vDJJx7Wq9I75bxjyyLgAYfQh9sccxOA0Oc7DnnU',
        },

        // GENERAL SETTINGS
        length: 100,
        update_period: 30000,
        show_media: true,
        template_html: '<div class="post-wrapper data-ix="fadeinup-scroll" dt-create="{{=it.dt_create}}"social-feed-id = "{{=it.id}}"><div class="post"><div class="post-media">{{=it.attachment}}</div><div class="post-content"><div class="post-head w-clearfix"><i class="fa fa-{{=it.social_network}} icon-posthead"></i><p class="posthead-user"><a href="{{=it.author_link}}" class="inline-link user">{{=it.author_name}}</a></p></div><p class="post-body">{{=it.text}}</p><div class="post-footer w-clearfix"><i class="fa fa-clock-o icon-posthead"></i><p class="posthead-user">{{=it.time_ago}}</p><p class="post-read-more"><a href="{{=it.link}}" class="inline-link post">read more</a></p></div></div></div></div>',
        date_format: "ll",
        date_locale: "en",
        callback: function () {
            var $grid = $('#socialPosts').imagesLoaded(function () {
                $grid.isotope({
                    itemSelector: '.post-wrapper',
                    layoutMode: 'masonry',
                });
            });

            $('.post-wrapper a').attr('target', '_blank');
            $('.load-posts-wrapper').fadeIn();
        }
    });

    $('.nav-dropdown a').click(function () {
        $(this).closest('.nav-dropdown').triggerHandler('w-close');
    });


    $(window).scroll(function () {
        if ($(this).scrollTop() >= 30) {
            $('#navMobile').css({
                'background-color': 'white',
                'border-bottom-color': 'rgba(115, 115, 115, 0.15)'
            });
            $('.logo-white').css({
                'opacity': '0'
            });
            $('.logo-color,.nav-bg').css({
                'opacity': '1'
            });
            $('.nav-toggle').css({
                'border-color': '#be1e2d',
                'color': '#be1e2d'
            });
            $('.nav-sep').css({
                'background-color': 'rgba(115, 115, 115, 0.15)'
            });

        } else {
            $('#navMobile,.logo-white,.logo-color,.nav-bg,.nav-toggle,.nav-sep').removeAttr('style');
        }
    });

    $('.media-block').hover(function (e) {
        var getImage = $(this).find('.gallery-thumbnail').css('background-image').replace(/^url\(['"](.+)['"]\)/, '$1');
        $('.media-bg').css({
            'background-image': 'url(' + getImage + ')',
            'transition': 'background 0.5s ease',
            '-webkit-transition': 'background 0.5s ease'
        });
    });
});

    var Webflow = Webflow || [];
    Webflow.push(function () {
        $('#donateForm').submit(function () {
            event.preventDefault();

            var name = encodeURIComponent($('#donateName').val().trim()),
                email = $('#donateEmail').val().trim();

            if ($('.form-amount').val() === '') {
                $('.donate-error').fadeIn('slow');
            } else if ($('.custom-donate-field').val().length > 0) {
                var formAmount = $('.custom-donate-field').val();

                $('.donate-error').fadeOut('slow');
                $('#donateBtn').val('validating...');

                setTimeout(function () {
                    location.href = 'https://plasso.com/s/Rqgy4ki62s?name=' + name + '&email=' + email + '&price=' + formAmount;
                }, 2000);
                $('#donateBtn').val('redirecting...');
            } else {
                var formAmount = $('.form-amount').val();

                $('.donate-error').fadeOut('slow');
                $('#donateBtn').val('validating...');

                setTimeout(function () {
                    location.href = 'https://plasso.com/s/GsfnDYZ02p?name=' + name + '&email=' + email + '&preselect=donate_' + formAmount + '&show_products=donate_' + formAmount;
                }, 2000);
                $('#donateBtn').val('redirecting...');
            }

            $('.form-amount').remove();

            return true;
        });
    });
